EL MEJOR CENTRO COMERCIAL DE V.O. DE LA COSTA 

Vehículos incluyendo transferencia, revisión completa antes de entregar, también trabajamos con financiera. Empresa profesional. Ven a visitarnos y lesbuscaremos una oferta que no podrás rechazar. 
Hablamos Español, Ingles y Escandinavo correo;

Nuestra empresa fue fundada en el año 1999 por José Manuel Adame. Abrimos nuestra primera tienda en Córdoba Capital en el Polígono de la Torrecilla, y en el año 2005 nos expandimos a Palma del Río, donde nos encontramos actualmente. Contamos con instalaciones de 1000 metros de parcela, de los cuales dedicamos 400 a la exposición de vehículos y 250 al taller mecánico. 

Ofrecemos un servicio de atención al cliente 24 horas y una amplia variedad de servicios: 

Venta de vehículos multimarca de segunda mano, seminuevos, de entre 2 a 4 años de antigüedad y con certificación de kilómetros. En nuestras instalaciones podrás encontrar vehículos de alta gama; 
Compra de vehículos por encargo; 
Servicio Financiación el 100% en 8 años, sin necesidad de anticipo; 
Servicio de Gestoría: el cliente que compra un vehículo se va con toda la documentación en regla, se tramita la trasferencia de vehículo desde el mismo establecimiento. Este servicio también se ofrece a cualquier persona que lo solicite, aunque no sea cliente; 
Llevamos tu coche a pasar la ITV, previamente se hace una revisión, y se repara lo que sea necesario; 
Cambio de aceite, filtros, neumáticos, preparación ITV, lavadero, limpieza integral de vehículos. 
Estamos asociados con diferentes talleres para poder brindarte todo lo que necesites. Entre ellos los Talleres Velasco, Talleres Zamora, Talleres Hnos. Fernández y Talleres Ponce. 

Las ventas del año 2016 superaron los 200 vehículos.
